export const TotalMoney = ({ listTransactions }) => {
  const totalMoney = listTransactions.reduce((acc, act) => acc + +act.value, 0);

  return (
    <section className="TotalMoney">
      <div>
        <p>Valor Total:</p>
        <span>O valor se refere ao saldo</span>
      </div>
      <span>{`R$ ${totalMoney},00`}</span>
    </section>
  );
};
